import React, { Component } from 'react';
import { useEffect, useState } from 'react';

export class FindConvexHull extends Component {
    static displayName = FindConvexHull.name;

    constructor(props) {
        super(props);
        this.state = {name:''};
    }

    PrintNonsense() {
        const [pointsEntered, setPointsEntered] = useState([]);
        return ('Nonsense');
    }   

    render() {
        let contents = 'Hello world, hello ' + this.state.name + '!';

        return (
            <div>
                Hello, {this.PrintNonsense()}
            </div>
        );
    }
}
